export function getTextObj(text){
    let info = {}
    if (text) {
      info.textlength = text.length;
      info.text = text;
    }
    else {info=undefined}
  
    info.textlength > 0  ? info.isNullorEmpty = true : info.isNullorEmpty = false;

   return info;
  }

  export function getMassChangeClass(mass, str, bool) {
     (bool) ? mass.filter(el => 
      el !== str).push (str) : delete mass[mass.indexOf(str)] ; return mass;}
